Here is a simple example of how you can create a Rust app that supports the ElevenLabs.io API and reads the contents of the clipboard aloud using TTS:

First, add the following dependencies to your `Cargo.toml` file:
```toml
[dependencies]
reqwest = "0.11.6"
tts = "0.1.0"
clipboard = "0.1.0"
```
Next, create a new Rust file called `main.rs` and add the following code:
```rust
use reqwest;
use tts::{Tts, Voice};
use clipboard::Clipboard;

#[tokio::main]
async fn main() {
    // Set up the ElevenLabs.io API credentials
    let api_key = "YOUR_API_KEY";
    let api_secret = "YOUR_API_SECRET";

    // Set up the TTS voice
    let voice = Voice::new("en-US", "female");

    // Get the contents of the clipboard
    let clipboard = Clipboard::new().unwrap();
    let text = clipboard.get_text().unwrap();

    // Create a new TTS instance
    let tts = Tts::new(voice);

    // Use the ElevenLabs.io API to get the audio URL
    let res = reqwest::get(format!("https://api.elevenlabs.io/v1/text-to-speech?text={}&key={}&secret={}", text, api_key, api_secret))
        .await
        .unwrap();

    // Get the audio URL from the response
    let audio_url = res.json::<AudioUrl>().unwrap();

    // Download the audio file
    let audio = reqwest::get(audio_url.url).await.unwrap();

    // Play the audio file
    tts.play(audio).await.unwrap();
}

struct AudioUrl {
    url: String,
}
```
This code uses the `reqwest` crate to make a GET request to the ElevenLabs.io API, which returns the audio URL. It then uses the `tts` crate to play the audio file.

Note that you'll need to replace `YOUR_API_KEY` and `YOUR_API_SECRET` with your actual ElevenLabs.io API credentials.

Also, this is just a simple example and you may want to add error handling and other features to your app.

You can run the app using `cargo run`.

